DROP TABLE FLIGHT_EMPLOYEE;
DROP TABLE FLIGHT;
DROP TABLE EMPLOYEE;
DROP TABLE PLANE;
DROP TABLE AIRLINE;
DROP TABLE AIRPORT;

create table Airport (
  ID        number(10) not null, 
  NAME      varchar2(255) not null, 
  CODE      varchar2(255) not null unique, 
  LONGITUDE double precision not null, 
  LATITUDE  double precision not null, 
  COUNTRY   varchar2(255) not null, 
  CITY      varchar2(255) not null, 
  primary key (ID));
create table Flight (
  ID                  number(10) not null, 
  FLIGHT_NUMBER       varchar2(255) not null, 
  DESTINATION_COUNTRY varchar2(255) not null, 
  DESTINATION_CITY    varchar2(255) not null, 
  DEPARTURE           date not null, 
  ARRIVAL             date not null, 
  PASSENGERS          number(10) not null, 
  STATUS              varchar2(255) not null, 
  DELAY               float(10), 
  IS_NATIONAL         number(1) not null, 
  PLANE_ID            number(10) not null, 
  AIRPORT_ID          number(10) not null, 
  primary key (ID));
create table Plane (
  ID              number(10) not null, 
  MANUFACTURER    varchar2(255) not null, 
  MODEL           varchar2(255) not null, 
  PRODUCTION_DATE date not null, 
  SEAT_COUNT      number(10) not null, 
  FUEL_CAPACITY   float(10) not null, 
  CRUISING_RANGE  number(10) not null, 
  AIRLINE_ID      number(10) not null, 
  primary key (ID));
create table Airline (
  ID                 number(10) not null, 
  COMPANY            varchar2(255) not null, 
  CODE               varchar2(255) not null unique, 
  COUNTRY            varchar2(255) not null, 
  ESTABLISHMENT_DATE date, 
  primary key (ID));
create table Employee (
  ID              number(10) not null, 
  NAME            varchar2(255) not null, 
  SURNAME         varchar2(255) not null, 
  BIRTHDATE       date not null, 
  GENDER          number(1) not null, 
  OCCUPATION      varchar2(255) not null, 
  EMPLOYMENT_DATE date not null, 
  FLOWN_HOURS     number(10) not null, 
  AIRLINE_ID      number(10) not null, 
  primary key (ID));
create table Flight_Employee (
  FLIGHT_ID   number(10) not null, 
  EMPLOYEE_ID number(10) not null, 
  primary key (FLIGHT_ID, 
  EMPLOYEE_ID));
alter table Flight add constraint FKFlight997633 foreign key (PLANE_ID) references Plane (ID) on delete cascade;
alter table Flight add constraint FKFlight773143 foreign key (AIRPORT_ID) references Airport (ID) on delete cascade;
alter table Employee add constraint FKEmployee787037 foreign key (AIRLINE_ID) references Airline (ID) on delete cascade;
alter table Flight_Employee add constraint FKFlight_Emp815646 foreign key (FLIGHT_ID) references Flight (ID) on delete cascade;
alter table Flight_Employee add constraint FKFlight_Emp513036 foreign key (EMPLOYEE_ID) references Employee (ID) on delete cascade;
alter table Plane add constraint FKPlane132049 foreign key (AIRLINE_ID) references Airline (ID) on delete cascade;

